import {BrowserRouter as Router,  Switch, Route} from "react-router-dom"
import index_Home from "./page/index_Home"



function App() {
  return (
    <div className="App">
      <Router>
          <Switch>
              <Route path="/" exact component={index_Home}/>
       
            
          </Switch>
      </Router>
    </div>
  );
}

export default App;
